import React from 'react';
import {Container, Row, Col} from 'react-bootstrap';
import Header from '../Header';


function Home() {
  document.title="Home Page"
  return (
    <div>
      <Container fluid className="pr-0 pl-0">
        <Header />
        <div id="front-image">
        </div>
      </Container>
      <Row>
        
          <p>a</p>

      </Row>

    </div>
  );
}

export default Home;
